import React from 'react';
import Login from './Login';

function LoginList({ logins, onDelete, onEdit }) {
    return (
        <table id="logins">
            <thead>
                <tr>
                    <th>Website</th>
                    <th>Username</th>
                    <th>Password</th>                                 
                </tr>
            </thead>
            <tbody>
                {logins.map((login, i) => <Login login={login}
                    onDelete={onDelete} 
                    onEdit = {onEdit}
                    key={i} />)}
            </tbody>
        </table>
    );
}

export default LoginList;
